INSERT INTO `authors` (`authorID`, `authorname`, `authordescription`) VALUES
(1, 'Daniel Defoe', 'Daniel Defoe (born 1660, London, Eng.—died April 24, 1731, London) was an English novelist, pamphleteer, and journalist, known as the author of Robinson Crusoe (1719–22) and Moll Flanders (1722).'),
(2, 'Mark Twain', 'Mark Twain (born November 30, 1835, Florida, Missouri, U.S.—died April 21, 1910, Redding, Connecticut) was an American humorist, journalist, lecturer, and novelist who acquired international fame for his travel narratives, especially The Innocents Abroad (1869), Roughing It (1872), and Life on the Mississippi (1883), and for his adventure stories of boyhood, especially The Adventures of Tom Sawyer (1876) and Adventures of Huckleberry Finn (1885). A gifted raconteur, distinctive humorist, and irascible moralist, he transcended the apparent limitations of his origins to become a popular public figure and one of America’s best and most beloved writers.'),
(3, 'Arthur Conan Doyle', 'Arthur Conan Doyle (born May 22, 1859, Edinburgh, Scotland—died July 7, 1930, Crowborough, Sussex, England) was a Scottish writer best known for his creation of the detective Sherlock Holmes—one of the most vivid and enduring characters in English fiction.\r\n\r\nConan Doyle, the second of Charles Altamont and Mary Foley Doyle’s 10 children, began seven years of Jesuit education in Lancashire, England, in 1868. After an additional year of schooling in Feldkirch, Austria, Conan Doyle returned to Edinburgh. Through the influence of Dr. Bryan Charles Waller, his mother’s lodger, he prepared for entry into the University of Edinburgh’s Medical School. He received Bachelor of Medicine and Master of Surgery qualifications from Edinburgh in 1881 and an M.D. in 1885 upon completing his thesis, “An Essay upon the Vasomotor Changes in Tabes Dorsalis.”'),
(4, 'Robert Louis Stevenson', 'Robert Louis Stevenson (born November 13, 1850, Edinburgh, Scotland—died December 3, 1894, Vailima, Samoa) was a Scottish essayist, poet, and author of fiction and travel books, best known for his novels Treasure Island (1881), Kidnapped (1886), Strange Case of Dr. Jekyll and Mr. Hyde (1886), and The Master of Ballantrae (1889). Stevenson was the only son of Thomas Stevenson, a prosperous civil engineer, and his wife, Margaret Isabella Balfour. His poor health made regular schooling difficult, but he attended Edinburgh Academy and other schools before, at age 17, entering Edinburgh University, where he was expected to prepare himself for the family profession of lighthouse engineering. But Stevenson had no desire to be an engineer, and he eventually agreed with his father, as a compromise, to prepare instead for the Scottish bar.'),
(5, 'Jules Verne', 'Jules Verne (born February 8, 1828, Nantes, France—died March 24, 1905, Amiens) was a prolific French author whose writings laid much of the foundation of modern science fiction.\r\n\r\nVerne’s father, intending that Jules follow in his footsteps as an attorney, sent him to Paris to study law. But the young Verne fell in love with literature, especially theatre. He wrote several plays, worked as secretary of the Théâtre Lyrique (1852–54), and published short stories and scientific essays in the periodical Musée des familles. In 1857 Verne married and for several years worked as a broker at the Paris Stock Market. During this period he continued to write, to do research at the Bibliothèque Nationale (National Library), and to dream of a new kind of novel—one that would combine scientific fact with adventure fiction. In September 1862 Verne met Pierre-Jules Hetzel, who agreed to publish the first of Verne’s Voyages extraordinaires (“Extraordinary Journeys”)—Cinq semaines en ballon (1863; Five Weeks in a Balloon). Initially serialized in Hetzel’s Le Magasin d’éducation et de récréation, the novel became an international best seller, and Hetzel offered Verne a long-term contract to produce many more works of “scientific fiction.” Verne subsequently quit his job at the stock market to become a full-time writer and began what would prove to be a highly successful author-publisher collaboration that lasted for more than 40 years and resulted in more than 60 works in the popular series Voyages extraordinaires.');

