INSERT INTO `books` (`bookID`, `author_ID`, `coverpic`, `bookname`, `genre`, `authorname`, `bookdescription`) VALUES
(1, 1, , 'The Life and Adventures of Robinson Crusoe', 'novel, adventure fiction, historical fiction', 'Daniel Defoe', 'Crusoe is the novel’s narrator. He describes how, as a headstrong young man, he ignored his family’s advice and left his comfortable middle-class home in England to go to sea. His first experience on a ship nearly kills him, but he perseveres, and a voyage to Guinea “made me both a Sailor and a Merchant,” Crusoe explains. Now several hundred pounds richer, he sails again for Africa but is captured by pirates and sold into slavery. He escapes and ends up in Brazil, where he acquires a plantation and prospers. Ambitious for more wealth, Crusoe makes a deal with merchants and other plantation owners to sail to Guinea, buy slaves, and return with them to Brazil. But he encounters a storm in the Caribbean, and his ship is nearly destroyed. Crusoe is the only survivor, washed up onto a desolate shore. He salvages what he can from the wreck and establishes a life on the island that consists of spiritual reflection and practical measures to survive. He carefully documents in a journal everything he does and experiences.');
INSERT INTO `books` (`bookID`, `author_ID`, `coverpic`, `bookname`, `genre`, `authorname`, `bookdescription`) VALUES
(2, 2, , 'The Adventures of Huckleberry Finn', 'Novel, Satire, Humor, Children\'s literature, Adventure fiction, Bildungsroman, Picaresque novel, Robinsonade', 'Mark Twain', 'The book’s narrator is Huckleberry Finn, a youngster whose artless vernacular speech is admirably adapted to detailed and poetic descriptions of scenes, vivid representations of characters, and narrative renditions that are both broadly comic and subtly ironic.\r\n\r\nHuck runs away from his abusive father and, with his companion, the runaway slave Jim, makes a long and frequently interrupted voyage down the Mississippi River on a raft. During the journey Huck encounters a variety of characters and types in whom the book memorably portrays almost every class living on or along the river. As a result of these experiences, Huck overcomes conventional racial prejudices and learns to respect and love Jim. The book’s pages are dotted with idyllic descriptions of the great river and the surrounding forests, and Huck’s good nature and unconscious humour permeate the whole. But a thread that runs through adventure after adventure is that of human cruelty, which shows itself both in the acts of individuals and in their unthinking acceptance of such institutions as slavery. The natural goodness of Huck is continually contrasted with the effects of a corrupt society.');
INSERT INTO `books` (`bookID`, `author_ID`, `coverpic`, `bookname`, `genre`, `authorname`, `bookdescription`) VALUES
(3, 3, , 'The Adventures of Sherlock Holmes', 'Short Story, Novel, Mystery, Detective fiction, Crime Fiction, Noir fiction', 'Arthur Conan Doyle', 'The Adventures of Sherlock Holmes is a collection of short stories by British writer Arthur Conan Doyle, first published on 14 October 1892. It contains the earliest short stories featuring the consulting detective Sherlock Holmes, which had been published in twelve monthly issues of The Strand Magazine from July 1891 to June 1892. The stories are collected in the same sequence, which is not supported by any fictional chronology. The only characters common to all twelve are Holmes and Dr. Watson, and all are related in first-person narrative from Watson\'s point of view.\r\n\r\nIn general the stories in The Adventures of Sherlock Holmes identify, and try to correct, social injustices. Holmes is portrayed as offering a new, fairer sense of justice. The stories were well received, and boosted the subscriptions figures of The Strand Magazine, prompting Doyle to be able to demand more money for his next set of stories. The first story, \"A Scandal in Bohemia\", includes the character of Irene Adler, who, despite being featured only within this one story by Doyle, is a prominent character in modern Sherlock Holmes adaptations, often as a love interest for Holmes. Doyle included four of the stories from this collection in his twelve favourite Sherlock Holmes stories, picking \"The Adventure of the Speckled Band\" as his overall favourite.');
INSERT INTO `books` (`bookID`, `author_ID`, `coverpic`, `bookname`, `genre`, `authorname`, `bookdescription`) VALUES
(4, 2, , 'The Adventures of Tom Sawyer', 'Novel, Children\'s literature, Adventure fiction, Satire, Folklore, Bildungsroman, Picaresque novel', 'Mark Twain', 'An orphan, Tom Sawyer lives with his Aunt Polly and half brother, Sid, in St. Petersburg, Missouri, on the Mississippi River; the fictional town is based on Hannibal, Missouri, where Twain grew up. The early chapters highlight Tom’s propensity for trouble. First he angers his aunt by eating jam, then he gets in a fight with another boy. As punishment for his various misdeeds, Aunt Polly orders him to whitewash the fence. However, Tom manages to convince other children that whitewashing is fun, and they end up giving him various items for a turn at the fence. Later in the book Tom goes to the cemetery with Huckleberry Finn, a vagabond whose father is a heavy drinker. The duo come across three grave robbers, including Injun Joe and Dr. Robinson. The two men get into a fight, and Injun Joe murders the doctor. Although Tom and Huckleberry promise never to tell anyone what they saw, Tom ultimately testifies against Injun Joe, who escapes.');
INSERT INTO `books` (`bookID`, `author_ID`, `coverpic`, `bookname`, `genre`, `authorname`, `bookdescription`) VALUES
(5, 4, , 'Kidnapped', 'Novel, Adventure fiction, historical novel, Speculative fiction', 'Robert Louis Stevenson', 'After the death of his father, young David Balfour discovers that his uncle Ebenezer has cheated him out of his inheritance. Subsequently, his uncle has David kidnapped and placed on a ship bound for the Carolinas. Aboard ship, Balfour and Alan Breck, a political rebel, become friends. When the ship is wrecked, they escape across the Scottish Highlands under suspicion of having committed a political murder that they accidentally witnessed. Balfour eventually reclaims his inheritance and also aids Breck’s cause.');
INSERT INTO `books` (`bookID`, `author_ID`, `coverpic`, `bookname`, `genre`, `authorname`, `bookdescription`) VALUES
(6, 4, , 'Treasure Island', 'Novel, Adventure fiction, Young adult literature', 'Robert Louis Stevenson', 'The main character, young Jim Hawkins, helps his parents run the Admiral Benbow, an inn near Bristol, England. One day a desperate-looking ruffian, Billy Bones (“the captain”), appears and takes a room. After being visited by a former mate named Black Dog, Billy suffers a stroke. Later, while drinking rum, he tells Jim that he is a pirate and that he has a treasure map. However, Billy fears that another pirate might mark him with a black spot (a summons or threat). Shortly thereafter, Jim’s ailing father, who is being tended to by Dr. Livesey, dies. A blind beggar, later revealed to be the pirate Pew, subsequently arrives and puts something in Bones’s hand. After Pew leaves, Billy has a fatal stroke. Jim and his mother open Billy’s sea chest, taking the money owed to them as well as a packet, before fleeing. A group of pirates led by Pew descends on the inn, but they are soon scared off by the sound of approaching horses; Pew is trampled to death. Believing that the pirates were searching for the packet, Jim seeks out Dr. Livesey, who is with Squire Trelawny. The packet is revealed to contain a treasure map, and the three decide to mount an expedition to Skeleton Island to find the hidden riches. However, they are fooled into hiring some of Billy’s former shipmates, including the leader of the pirates, Long John Silver.\r\n\r\nDuring the voyage, Jim overhears Silver and his men planning to steal the treasure once it is found and to kill all of the non-pirates. What follows is a rip-roaring tale of mutiny, treachery, swordfights, and murder as Jim, Dr. Livesey, and the squire are forced to live by their wits in order to survive against ruthless enemies. They are aided by Captain Smollet and by Ben Gunn, a pirate marooned on Skeleton Island. Jim and the others ultimately prevail over the pirates and return home with the treasure. Silver notably escapes with some of the money.');
INSERT INTO `books` (`bookID`, `author_ID`, `coverpic`, `bookname`, `genre`, `authorname`, `bookdescription`) VALUES
(7, 5, , 'A Journey to the Centre of the Earth', 'Novel, Science, Science fiction, Adventure fiction, Scientific romance', 'Jules Verne', 'Journey to the Center of the Earth (French: Voyage au centre de la Terre, also translated under the titles A Journey to the Centre of the Earth and A Journey to the Interior of the Earth) is an 1864 novel by Jules Verne. The story involves German professor Otto Lidenbrock who believes there are volcanic tubes going toward the centre of the Earth. He, his nephew Axel, and their guide Hans descend into the Icelandic volcano Snæfellsjökull, encountering many adventures, including prehistoric animals and natural hazards, before eventually coming to the surface again in southern Italy, at the Stromboli volcano.');

